import React, { useEffect, useState } from 'react';
import {  getListCocktail } from '../../hooks/api';


const List = () => {

  const [dataList, setDataList] = useState([])
  useEffect(() => {
    (async function() {
      try {
        const {data } = await getListCocktail();
        if (data && data.drinks) {
          setDataList(data.drinks);
        }
      } catch (e) {
        console.log(e);
      }
    })();
  }, [])

  return (
    <div className='drinkContainer'>
        <div className='drinkArticles'>
              {dataList.map(el => (
                 <p key={el.id} item={el}></p>
              ))}
        </div>
    </div>
  )
}

export { List };
